import React, {useEffect, useState} from "react";
import {getDetails, roundSeparateNumber} from "../../../common/utils";
import {getCripto, getCurrentCripto} from "../../../common/fetch";
import {
    Area,
    AreaChart,
    Bar,
    Brush,
    CartesianGrid,
    ComposedChart,
    Legend,
    Line,
    Pie,
    PieChart,
    ResponsiveContainer,
    Tooltip,
    XAxis,
    LineChart,
    YAxis
} from "recharts";
import {} from "recharts/src/chart/LineChart";
const ItemTableCurrency = ({asset}) => {
    const [isOpenDetails, setIsOpenDetails] = useState(false);
    const [assetDetails, setAssetDetails] = useState([]);
    const [details, setDetails] = useState({});
    const options = { year: 'numeric', month: 'long', day: 'numeric' };
    const now  = new Date();
    const startDay = (new Date()).setUTCHours(0,0,0,0);
    const date = now.toLocaleDateString("en-US", options);

    const openDetails = () => {
        setIsOpenDetails(!isOpenDetails);
        (async () => {
            const assetsFetch = await getCurrentCripto(asset.id, startDay, now.getTime());
            setAssetDetails(assetsFetch.data);
        })();
    }

    useEffect(() => {
        assetDetails.length && setDetails(getDetails(assetDetails));
    }, [assetDetails]);

const data=[
    {"priceUsd":"61226.7083409046420848","date":"2021-10-23T04:00:00.000Z"},
    {"priceUsd":"61201.4580805944749707", "date":"2021-10-23T05:00:00.000Z"},
    {"priceUsd":"60988.0566222774886753","date":"2021-10-23T06:00:00.000Z"},
    {"priceUsd":"61039.4503999995501601","date":"2021-10-23T07:00:00.000Z"},
    {"priceUsd":"60914.0208304518500625","date":"2021-10-23T08:00:00.000Z"},
    {"priceUsd":"61084.4396688699234585","date":"2021-10-23T09:00:00.000Z"},
    {"priceUsd":"60681.4959908074350736","date":"2021-10-23T10:00:00.000Z"},
    {"priceUsd":"60211.7744574443810566","date":"2021-10-23T11:00:00.000Z"}
];

    return (
        <>
            <tr onClick={openDetails}>
                <td>{asset.rank}</td>
                <td>{asset.name}</td>
                <td>${roundSeparateNumber(asset.priceUsd)}</td>
                <td>${roundSeparateNumber(asset.marketCapUsd)}</td>
                <td>${roundSeparateNumber(asset.vwap24Hr)}</td>
                <td>${roundSeparateNumber(asset.supply)}</td>
                <td>${roundSeparateNumber(asset.volumeUsd24Hr)}</td>
                <td>{roundSeparateNumber(asset.changePercent24Hr)}%</td>
            </tr>
            {isOpenDetails && <>
                <tr className="subTable__row">
                    <td colSpan={2} rowSpan={2}>
                        <img src={`https://assets.coincap.io/assets/icons/${asset.symbol.toLowerCase()}@2x.png`}/>
                    </td>
                    <td colSpan={2}>
                        {asset.name} ({asset.symbol})
                    </td>
                    <td colSpan={2}>HIGH: ${roundSeparateNumber(details.max)}</td>
                    <td colSpan={2} rowSpan={2} class="align-middle">AVERAGE: ${roundSeparateNumber(details.average)}</td>
                </tr>
                    <tr className="subTable__row">
                        <td colSpan={2}>{date}</td>
                        <td colSpan={2}>LOW: ${roundSeparateNumber(details.min)}</td>
                    </tr>
                <tr>
                    <AreaChart
                        width={400}
                        height={400}
                        data={data}
                        margin={{ top: 5, right: 20, left: 10, bottom: 5 }}
                    >
                        <XAxis dataKey="name" />
                        <Tooltip />
                        <CartesianGrid stroke="#f5f5f5" />
                        <Line type="monotone" dataKey="uv" stroke="#ff7300" yAxisId={0} />
                        <Line type="monotone" dataKey="pv" stroke="#387908" yAxisId={1} />
                    </AreaChart>
                </tr>
                </>
                }
            </>
                )
            }
;

export default ItemTableCurrency;
